function App() {
  const [searchTerm, setSearchTerm] = useState("");
  // Ensure these arrays are defined!
  const [allEvents] = useState([
    { id: 1, title: "Tech Summit", date: "Mar 18", location: "Block A", category: "Tech", image: "..." }
  ]);
  const [registeredList] = useState([
    { id: 101, name: "Workshop", date: "Mar 20", venue: "Auditorium", ticketId: "ST-1234" }
  ]);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard events={allEvents} userName="Priya Sharma" searchTerm={searchTerm} setSearchTerm={setSearchTerm} />} />
        <Route path="/events" element={<Events events={allEvents} searchTerm={searchTerm} setSearchTerm={setSearchTerm} />} />
        <Route path="/my-events" element={<MyEvents registeredEvents={registeredList} />} />
        <Route path="/profile" element={<Profile userName="Priya Sharma" />} />
      </Routes>
    </Router>
  );
}
